import { Input, DatePicker, Button, Select } from 'antd';
import './style-jobBoard.css';

function JobBoard(props) {
  const { Option } = Select;
  return (
    <>
      <div className="flex-container jobBoard">
        {/* <Input
          placeholder="Basic usage"
          style={{ width: `20%`, float: 'left' }}
        />
        <Input placeholder="Basic usage" style={{ width: `20%` }} />
        <Input placeholder="Basic usage" style={{ width: `20%` }} /> */}
        <DatePicker placeholder="Show result from" className="JobBoard-input" />
        <DatePicker placeholder="Show result to" className="JobBoard-input" />
        <Select
          showSearch
          style={{ width: 200 }}
          placeholder="Select a person"
          optionFilterProp="children"
          onChange={onChange}
          onFocus={onFocus}
          onBlur={onBlur}
          onSearch={onSearch}
          filterOption={(input, option) =>
            option.children.toLowerCase().indexOf(input.toLowerCase()) >= 0
          }
        >
          <Option value="jack">Jack</Option>
          <Option value="lucy">Lucy</Option>
          <Option value="tom">Tom</Option>
        </Select>
        ,
      </div>
    </>
  );
}

export default JobBoard;
